script: |
  super -f text -I q13404.spq | sort > q13404.out

inputs:
  - name: q13404.spq
    data: |
      SELECT ALL - col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( ( + col2 + + ( - - ( 85 ) ) - - - 61 - col1 / col0 + + col1 * + + col2 + 60 ) IS NULL );
  - name: tab2

outputs:
  - name: q13404.out
    data: |
      -46
      -64
      -75
